function [ret,x0,str,ts,xts]=diaglib(t,x,u,flag);%DIAGLIB	is the M-file description of the SIMULINK system named DIAGLIB.%	The block-diagram can be displayed by typing: DIAGLIB.%%	SYS=DIAGLIB(T,X,U,FLAG) returns depending on FLAG certain%	system values given time point, T, current state vector, X,%	and input vector, U.%	FLAG is used to indicate the type of output to be returned in SYS.%%	Setting FLAG=1 causes DIAGLIB to return state derivatives, FLAG=2%	discrete states, FLAG=3 system outputs and FLAG=4 next sample%	time. For more information and other options see SFUNC.%%	Calling DIAGLIB with a FLAG of zero:%	[SIZES]=DIAGLIB([],[],[],0),  returns a vector, SIZES, which%	contains the sizes of the state vector and other parameters.%		SIZES(1) number of states%		SIZES(2) number of discrete states%		SIZES(3) number of outputs%		SIZES(4) number of inputs%		SIZES(5) number of roots (currently unsupported)%		SIZES(6) direct feedthrough flag%		SIZES(7) number of sample times%%	For the definition of other parameters in SIZES, see SFUNC.%	See also, TRIM, LINMOD, LINSIM, EULER, RK23, RK45, ADAMS, GEAR.% Note: This M-file is only used for saving graphical information;%       after the model is loaded into memory an internal model%       representation is used.% the system will take on the name of this mfile:sys = mfilename;new_system(sys)simver(1.3)if (0 == (nargin + nargout))     set_param(sys,'Location',[153,88,628,296])     open_system(sys)end;set_param(sys,'algorithm',     'RK-45')set_param(sys,'Start time',    '0.0')set_param(sys,'Stop time',     '999999')set_param(sys,'Min step size', '0.0001')set_param(sys,'Max step size', '10')set_param(sys,'Relative error','1e-3')set_param(sys,'Return vars',   '')%     Subsystem  'SP'.new_system([sys,'/','SP'])set_param([sys,'/','SP'],'Location',[5,43,390,193])set_param([sys,'/','SP'],...		'Mask Display','Smooth\nPursuit',...		'Mask Dialogue','eval(''spdiag'')')%     Finished composite block 'SP'.set_param([sys,'/','SP'],...		'ForeGround',4,...		'BackGround',7,...		'position',[47,25,100,76])%     Subsystem  'Saccadic'.new_system([sys,'/','Saccadic'])set_param([sys,'/','Saccadic'],'Location',[130,62,395,207])set_param([sys,'/','Saccadic'],...		'Mask Display','Saccadic',...		'Mask Dialogue','eval(''saccdiag'')')%     Finished composite block 'Saccadic'.set_param([sys,'/','Saccadic'],...		'ForeGround',5,...		'BackGround',4,...		'position',[142,22,205,76])%     Subsystem  ['SP + Sacc',13,'w IM'].new_system([sys,'/',['SP + Sacc',13,'w IM']])set_param([sys,'/',['SP + Sacc',13,'w IM']],'Location',[5,118,280,263])set_param([sys,'/',['SP + Sacc',13,'w IM']],...		'Mask Display','SP + Sacc\nw IM',...		'Mask Dialogue','eval(''spscdiag'')')%     Finished composite block ['SP + Sacc',13,'w IM'].set_param([sys,'/',['SP + Sacc',13,'w IM']],...		'BackGround',6,...		'position',[247,22,315,71])%     Subsystem  'CN'.new_system([sys,'/','CN'])set_param([sys,'/','CN'],'Location',[225,118,490,263])set_param([sys,'/','CN'],...		'Mask Display','CN',...		'Mask Dialogue','eval(''cndiag'')')%     Finished composite block 'CN'.set_param([sys,'/','CN'],...		'BackGround',6,...		'position',[372,22,430,71])%     Subsystem  'IM'.new_system([sys,'/','IM'])set_param([sys,'/','IM'],'Location',[386,50,866,288])set_param([sys,'/','IM'],...		'Mask Display','IM',...		'Mask Dialogue','eval(''imdiag'')')%     Finished composite block 'IM'.set_param([sys,'/','IM'],...		'ForeGround',5,...		'BackGround',2,...		'position',[45,127,100,176])%     Subsystem  'OMN'.new_system([sys,'/','OMN'])set_param([sys,'/','OMN'],'Location',[33,425,274,579])%     Subsystem  'OMN/OMN'.new_system([sys,'/','OMN/OMN'])set_param([sys,'/','OMN/OMN'],'Location',[118,101,655,332])add_block('built-in/Note',[sys,'/','OMN/OMN/OMN'])set_param([sys,'/','OMN/OMN/OMN'],...		'Font Weight','bold',...		'Font Size',12,...		'position',[40,15,45,20])%     Subsystem  'OMN/OMN/Sign'.new_system([sys,'/','OMN/OMN/Sign'])set_param([sys,'/','OMN/OMN/Sign'],'Location',[159,417,467,586])add_block('built-in/Constant',[sys,'/','OMN/OMN/Sign/Constant'])set_param([sys,'/','OMN/OMN/Sign/Constant'],...		'Value','0',...		'position',[65,105,85,125])add_block('built-in/Relational Operator',[sys,'/',['OMN/OMN/Sign/Relational',13,'Operator1']])set_param([sys,'/',['OMN/OMN/Sign/Relational',13,'Operator1']],...		'Operator','<',...		'position',[140,92,170,123])add_block('built-in/Sum',[sys,'/','OMN/OMN/Sign/Sum'])set_param([sys,'/','OMN/OMN/Sign/Sum'],...		'inputs','+-',...		'position',[215,64,235,91])add_block('built-in/Relational Operator',[sys,'/',['OMN/OMN/Sign/Relational',13,'Operator']])set_param([sys,'/',['OMN/OMN/Sign/Relational',13,'Operator']],...		'Operator','>',...		'position',[140,32,170,63])add_block('built-in/Inport',[sys,'/','OMN/OMN/Sign/in_1'])set_param([sys,'/','OMN/OMN/Sign/in_1'],...		'position',[35,30,55,50])add_block('built-in/Outport',[sys,'/','OMN/OMN/Sign/out_1'])set_param([sys,'/','OMN/OMN/Sign/out_1'],...		'position',[265,70,285,90])add_line([sys,'/','OMN/OMN/Sign'],[240,80;260,80])add_line([sys,'/','OMN/OMN/Sign'],[175,50;185,50;185,70;210,70])add_line([sys,'/','OMN/OMN/Sign'],[175,110;185,110;185,85;210,85])add_line([sys,'/','OMN/OMN/Sign'],[90,115;135,115])add_line([sys,'/','OMN/OMN/Sign'],[110,115;110,55;135,55])add_line([sys,'/','OMN/OMN/Sign'],[60,40;135,40])add_line([sys,'/','OMN/OMN/Sign'],[95,40;95,100;135,100])set_param([sys,'/','OMN/OMN/Sign'],...		'Mask Display','plot(-50,-50,50,50,[-50,50],[0,0],[0,0],[-50,50],[-40,0],[-30,-30],[0,40],[30,30])',...		'Mask Type','Sign',...		'Mask Dialogue','y = sign(x)')set_param([sys,'/','OMN/OMN/Sign'],...		'Mask Help','Sign Function:\n\t\t\ty = 1 if x > 0\n\t\t\ty = 0 if x = 0\n\t\t\ty = -1 if x < 0')%     Finished composite block 'OMN/OMN/Sign'.set_param([sys,'/','OMN/OMN/Sign'],...		'hide name',0,...		'position',[195,97,225,123])add_block('built-in/Abs',[sys,'/','OMN/OMN/Abs'])set_param([sys,'/','OMN/OMN/Abs'],...		'hide name',0,...		'position',[145,98,175,122])add_block('built-in/Switch',[sys,'/','OMN/OMN/Switch'])set_param([sys,'/','OMN/OMN/Switch'],...		'hide name',0,...		'Threshold','.5',...		'position',[430,94,460,126])add_block('built-in/Outport',[sys,'/',['OMN/OMN/pulse-',13,'step']])set_param([sys,'/',['OMN/OMN/pulse-',13,'step']],...		'position',[485,100,505,120])add_block('built-in/Gain',[sys,'/',['OMN/OMN/Gain',13,'_']])set_param([sys,'/',['OMN/OMN/Gain',13,'_']],...		'hide name',0,...		'Gain','1.0',...		'position',[160,26,195,54])add_block('built-in/Inport',[sys,'/','OMN/OMN/PG'])set_param([sys,'/','OMN/OMN/PG'],...		'ForeGround',5,...		'BackGround',4,...		'Port','2',...		'position',[70,100,90,120])add_block('built-in/Inport',[sys,'/',['OMN/OMN/E''']])set_param([sys,'/',['OMN/OMN/E''']],...		'position',[70,165,90,185])add_block('built-in/Sum',[sys,'/','OMN/OMN/Sum'])set_param([sys,'/','OMN/OMN/Sum'],...		'hide name',0,...		'position',[365,60,385,80])%     Subsystem  'OMN/OMN/SampHold?'.new_system([sys,'/','OMN/OMN/SampHold?'])set_param([sys,'/','OMN/OMN/SampHold?'],'Location',[101,119,316,218])add_block('built-in/Inport',[sys,'/','OMN/OMN/SampHold?/S//H?'])set_param([sys,'/','OMN/OMN/SampHold?/S//H?'],...		'Port','2',...		'position',[40,70,60,90])add_block('built-in/Inport',[sys,'/','OMN/OMN/SampHold?/Input'])set_param([sys,'/','OMN/OMN/SampHold?/Input'],...		'position',[30,15,50,35])add_block('built-in/Outport',[sys,'/','OMN/OMN/SampHold?/output'])set_param([sys,'/','OMN/OMN/SampHold?/output'],...		'position',[130,30,150,50])set_param([sys,'/','OMN/OMN/SampHold?'],...		'Mask Display','S&H\n(L)')%     Finished composite block 'OMN/OMN/SampHold?'.set_param([sys,'/','OMN/OMN/SampHold?'],...		'hide name',0,...		'position',[275,55,320,90])add_line([sys,'/','OMN/OMN'],[95,175;400,175;400,120;425,120])add_line([sys,'/','OMN/OMN'],[235,175;235,65;270,65])add_line([sys,'/','OMN/OMN'],[230,110;425,110])add_line([sys,'/','OMN/OMN'],[260,110;270,80])add_line([sys,'/','OMN/OMN'],[200,40;340,40;340,65;360,65])add_line([sys,'/','OMN/OMN'],[325,75;360,75])add_line([sys,'/','OMN/OMN'],[390,70;405,70;405,100;425,100])add_line([sys,'/','OMN/OMN'],[95,110;140,110])add_line([sys,'/','OMN/OMN'],[130,110;130,40;155,40])add_line([sys,'/','OMN/OMN'],[465,110;480,110])add_line([sys,'/','OMN/OMN'],[180,110;190,110])set_param([sys,'/','OMN/OMN'],...		'Mask Display','<--"t" \nOMN\n<--"ph"')%     Finished composite block 'OMN/OMN'.set_param([sys,'/','OMN/OMN'],...		'position',[90,47,135,103])set_param([sys,'/','OMN'],...		'Mask Display','OMN')%     Finished composite block 'OMN'.set_param([sys,'/','OMN'],...		'position',[380,125,430,176])%     Subsystem  'IMguts'.new_system([sys,'/','IMguts'])set_param([sys,'/','IMguts'],'Location',[386,50,866,288])set_param([sys,'/','IMguts'],...		'Mask Display','IM\nguts',...		'Mask Dialogue','eval(''imgutsd'')')%     Finished composite block 'IMguts'.set_param([sys,'/','IMguts'],...		'ForeGround',5,...		'BackGround',2,...		'position',[145,125,200,174])drawnow% Return any arguments.if (nargin | nargout)	% Must use feval here to access system in memory	if (nargin > 3)		if (flag == 0)			eval(['[ret,x0,str,ts,xts]=',sys,'(t,x,u,flag);'])		else			eval(['ret =', sys,'(t,x,u,flag);'])		end	else		[ret,x0,str,ts,xts] = feval(sys);	endelse	drawnow % Flash up the model and execute load callbackend